import {readFile as _readFile} from 'fs'
import resolve from './resolve'
import {tsortAsync} from './tsort'
import promisify from './promisify'

const readFile = promisify(_readFile)

function readRequireDirectives(code, callback) {
  const lines = code.match(/^\/\/=.+$/gm) || []
  for (const line of lines) {
    const m = line.match(/= require ([\w\.\/-]+)/)
    if (m) {
      callback(m[1])
    }
  }
}

function readStubDirectives(code, callback) {
  const lines = code.match(/^\/\/=.+$/gm) || []
  for (const line of lines) {
    const m = line.match(/= stub ([\w\.\/-]+)/)
    if (m) {
      callback(m[1])
    }
  }
}

function readImports(code, callback) {
  const lines = code.match(/^import.+$/gm) || []
  for (const line of lines) {
    const m = line.match(/^import.+['"]([\w\!\.\/-]+)['"];?$/)
    if (m) {
      callback('environment/require')
      callback(m[1])
    }
  }
}

function readAmdDeps(code, callback) {
  const lines = code.match(/^\s*define\(.+$/gm) || []
  for (const line of lines) {
    const m = line.match(/\[([^\]]+)\]/)
    if (m) {
      for (const dep of m[1].replace(/['"]/g, "").split(/\s*,\s*/)) {
        if (dep !== 'exports') {
          callback('environment/require')
          callback(dep)
        }
      }
    }
  }
}

function readRequires(code, callback) {
  const lines = code.match(/require\(.+$/gm) || []
  for (const line of lines) {
    const m = line.match(/require[ (]['"]([\w\/-]+)['"]/)
    if (m) {
      callback('environment/require')
      callback(m[1])
    }
  }
}

async function scanScriptRequiredDependencies(filename) {
  const basedir = dirname(filename)
  const code = await readFile(filename, 'utf8')

  const resolvers = []

  function push(path) {
    resolvers.push(resolve(path, basedir))
  }

  if (filename.match("app/assets/javascripts")) {
    readRequireDirectives(code, push)
    readRequires(code, push)
  } else if (filename.match("app/assets/modules")) {
    readRequireDirectives(code, push)
    readImports(code, push)
  } else if (filename.match("test/js")) {
    readRequireDirectives(code, push)
    readImports(code, push)
  } else if (filename.match("node_modules")) {
    readAmdDeps(code, push)
  }

  return Promise.all(resolvers)
}

async function scanScriptStubbedDependencies(filename) {
  const basedir = dirname(filename)
  const code = await readFile(filename, 'utf8')

  const resolvers = []

  readStubDirectives(code, path => {
    resolvers.push(resolve(path, basedir))
  })

  return Promise.all(resolvers)
}

async function traverseScriptRequiredDependencies(entry) {
  const ctx = {}
  return tsortAsync([entry], scanScriptRequiredDependencies.bind(ctx))
}

async function traverseScriptStubbedDependencies(entry) {
  const ctx = {}
  const stubbed = await scanScriptStubbedDependencies(entry)
  return tsortAsync(stubbed, scanScriptRequiredDependencies.bind(ctx))
}

export async function traverseScriptDependencies(entry) {
  const requiredPending = traverseScriptRequiredDependencies(entry)
  const stubbedPending = traverseScriptStubbedDependencies(entry)
  const required = await requiredPending
  const stubbed = await stubbedPending

  for (const filename of stubbed) {
    required.delete(filename)
  }

  return required
}

