// Public: Topological sort (DFS)
//
// https://en.wikipedia.org/wiki/Topological_sorting#Depth-first_search
//
// Examples
//
//   const simple = new Map()
//   simple.set(3, [8, 10])
//   simple.set(5, [11])
//   simple.set(7, [8, 11])
//   simple.set(8, [9])
//   simple.set(11, [2, 9, 10])
//   tsortAsync(simple.keys(), n => simple.get(n))
//   > 7, 5, 3, 11, 8, 10, 2, 9
//
//   const functions = new Map()
//   functions.set('main', ['parse_options', 'tail_file', 'tail_forever'])
//   functions.set('tail_file', ['pretty_name', 'write_header', 'tail'])
//   functions.set('tail_forever', ['recheck', 'pretty_name', 'write_header', 'dump_remainder'])
//   functions.set('tail', ['tail_lines', 'tail_bytes'])
//   functions.set('tail_lines', ['start_lines', 'dump_remainder', 'file_lines', 'pipe_lines'])
//   functions.set('tail_bytes', ['xlseek', 'start_bytes', 'dump_remainder', 'pipe_bytes'])
//   functions.set('file_lines', ['dump_remainder'])
//   functions.set('recheck', ['pretty_name'])
//   tsortAsync(functions.keys(), n => functions.get(n))
//
// Returns sorted Set.
export async function tsortAsync(nodes, getEdges) {
  // Empty list that will contain the sorted nodes
  const sorted = new Set()

  const marks = new Map()

  // function visit(node n)
  async function visit(node) {
    // if n has a temporary mark then stop (not a DAG)
    if (marks.get(node) === 'temporary') {
      throw new Error(`cycle in graph visiting ${node}`)

    // skip if n is already visited
    } else if (marks.get(node)) {
      return
    }

    // mark n temporarily
    marks.set(node, 'temporary')

    // for each node m with an edge from n to m do
    const edges = await getEdges(node)
    if (edges) {
      for (const edge of edges) {
        // visit(m)
        await visit(edge)
      }
    }

    // mark n permanently
    // unmark n temporarily
    marks.set(node, 'permanent')

    // add n to head of L
    sorted.add(node)
  }

  // while there are unmarked nodes do
  for (const node of nodes) {
    if (!marks.get(node)) {
      // visit(n)
      await visit(node)
    }
  }

  return sorted
}

