function readImports(code, callback) {
  const lines = code.match(/^import.+$/gm) || []
  for (const line of lines) {
    const m = line.match(/^import.+['"]([\w\!\.\/-]+)['"];?$/)
    if (m) {
      callback('environment/require')
      callback(m[1])
    }
  }
}

function readAmdDeps(code, callback) {
  const lines = code.match(/^\s*define\(.+$/gm) || []
  for (const line of lines) {
    const m = line.match(/\[([^\]]+)\]/)
    if (m) {
      for (const dep of m[1].replace(/['"]/g, "").split(/\s*,\s*/)) {
        if (dep !== 'exports') {
          callback('environment/require')
          callback(dep)
        }
      }
    }
  }
}

function readRequires(code, callback) {
  const lines = code.match(/require\(.+$/gm) || []
  for (const line of lines) {
    const m = line.match(/require[ (]['"]([\w\/-]+)['"]/)
    if (m) {
      callback('environment/require')
      callback(m[1])
    }
  }
}

async function scanScriptRequiredDependencies(filename) {
  const basedir = dirname(filename)
  const code = await readFile(filename, 'utf8')

  const resolvers = []

  function push(path) {
    resolvers.push(resolve(path, basedir))
  }

  if (filename.match("app/assets/javascripts")) {
    readRequireDirectives(code, push)
    readRequires(code, push)
  } else if (filename.match("app/assets/modules")) {
    readRequireDirectives(code, push)
    readImports(code, push)
  } else if (filename.match("test/js")) {
    readRequireDirectives(code, push)
    readImports(code, push)
  } else if (filename.match("node_modules")) {
    readAmdDeps(code, push)
  }

